import MainPage from "./pages/MainPage/MainPage";
import { BrowserRouter, Routes } from "react-router-dom";
import HeaderMenu from "./pages/header/HeaderManu";

export default function App() {
  return (
    <div className="App">
      <HeaderMenu />
      <BrowserRouter>
        <Routes>
          <Route path="/home" element={<MainPage />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}
